// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./implementation.sol";

/**
 * @title MyToken
 * @dev This is an implementation of an ERC20 token.
 * It initializes a total supply and assigns it to the deployer.
 */
contract MyToken is ERC20Implementation {
    constructor(
        uint256 initialSupply
    ) ERC20Implementation("MTEToken", "MTE", 18) {
        _mint(msg.sender, initialSupply); // Mint the initial supply and assign to deployer
    }
}

ERC20/implementation.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./interface.sol";

/**
 * @title ERC20Implementation
 * @dev It provides the basic implementation of a standard ERC20 token.
 * It handles the storage for balances and allowances and includes the core transfer logic.
 */
abstract contract ERC20Implementation is IERC20 {
    // Mappings
    mapping(address => uint256) private _balances; // store balances of each address
    mapping(address => mapping(address => uint256)) private _allowances; // store allowances of each spender for each owner

    // Token information
    string private _name;
    string private _symbol;
    uint8 private _decimals;
    uint256 private _totalSupply;

    constructor(string memory name_, string memory symbol_, uint8 decimals_) {
        _name = name_;
        _symbol = symbol_;
        _decimals = decimals_;
    }

    function name() public view returns (string memory) {
        return _name;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) public view returns (uint256) {
        return _balances[account];
    }

    function allowance(
        address owner,
        address spender
    ) public view returns (uint256) {
        return _allowances[owner][spender];
    }

    function transfer(address recipient, uint256 amount) public returns (bool) {
        _transfer(msg.sender, recipient, amount);
        return true;
    }

    function approve(address spender, uint256 amount) public returns (bool) {
        _approve(msg.sender, spender, amount);
        return true;
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public returns (bool) {
        _transfer(sender, recipient, amount);

        uint256 currentAllowance = _allowances[sender][msg.sender];
        require(
            currentAllowance >= amount,
            "ERC20: transfer amount exceeds allowance"
        );
        _approve(sender, msg.sender, currentAllowance - amount);
        return true;
    }

    function _transfer(
        address sender,
        address recipient,
        uint256 amount
    ) internal {
        require(sender != address(0), "ERC20: transfer from the zero address");
        require(recipient != address(0), "ERC20: transfer to the zero address");

        uint256 senderBalance = _balances[sender];
        require(
            senderBalance >= amount,
            "ERC20: transfer amount exceeds balance"
        );
        _balances[sender] = senderBalance - amount;

        _balances[recipient] = _balances[recipient] + amount;
        emit Transfer(sender, recipient, amount);
    }

    function _approve(address owner, address spender, uint256 amount) internal {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _mint(address account, uint256 amount) internal {
        require(account != address(0), "ERC20: mint to the zero address");
        _totalSupply = _totalSupply + amount;
        _balances[account] = _balances[account] + amount;
        emit Transfer(address(0), account, amount);
    }
}

ERC20/interface.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

/**
 * @title IERC20 Interface
 * @dev It defines the standard functions and events for an ERC20 token.
 */
interface IERC20 {
    // functions
    function name() external view returns (string memory);
    function symbol() external view returns (string memory);
    function decimals() external view returns (uint8);
    function totalSupply() external view returns (uint256);
    function balanceOf(address account) external view returns (uint256);
    function transfer(
        address recipient,
        uint256 amount
    ) external returns (bool);
    function approve(address spender, uint256 amount) external returns (bool);
    function allowance(
        address owner,
        address spender
    ) external view returns (uint256);
    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) external returns (bool);

    // events
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(
        address indexed owner,
        address indexed spender,
        uint256 value
    );
}

/**
    name: Token's name: MTEToken.
    symbol: Token's symbol: MTE.
    decimals: Number of token's decimals: 18.
    totalSupply: Total supply of tokens.
    balanceOf: Get the address' balance
    transfer: Transfer from sender to recipient
    approve: Approve a spender to withdraw from owner's account
    allowance: Get the amount approved to a spender to withdraw from an owner.
    transferFrom: Transfer token from sender to recipient, prior approval required with approve()
    Approval: emitted when approve() is called
 */

